#sociable {
    left: 0;
    position: absolute;
    text-align: left;
    top: 0;
    z-index: 100;
}
#sociable .popup {
	behavior: url('/wp-content/plugins/sociable/css/pie.htc');
	-moz-border-radius: 5px;
	-webkit-border-radius: 5px;
	-webkit-box-shadow: #999999 0px 0px 24px;
    border: 3px solid transparent;
    border-radius: 5px 5px 5px 5px;
    box-shadow: 0 0 7px #000000;
    position: relative;
	background: none repeat scroll 0 0 #FFFFFF;
}
#sociable .content {
	behavior: url('/wp-content/plugins/sociable/css/pie.htc');
    background: none repeat scroll 0 0 #FFFFFF;
    border-radius: 4px 4px 4px 4px;
    box-shadow: 0 0 7px #000000;
    display: table;
    padding: 10px;
    width: 370px;
}
#sociable .close {
    background: none repeat scroll 0 0 #FFFFFF;
    padding: 2px;
    position: absolute;
    right: 5px;
    top: 5px;
}
#sociable .close img {
    opacity: 0.3;
}

#sociable img {
    border: 0 none;
    margin: 0;
}
#sociable .close{
    background: none repeat scroll 0 0 #FFFFFF;
    padding: 2px;
    position: absolute;
    right: 5px;
    top: 5px;
}
.share_buttons{
	list-style:none;
}
.share_buttons li{
	float:left;
}

.clearfix:after {
	visibility: hidden;
	display: block;
	font-size: 0;
	content: " ";
	clear: both;
	height: 0;
}

