#brewery-page{
	background:url(../img/brewery/bgtile.jpg) repeat;
	background-size:100px 100px; 
	position:absolute;
	height:100%;
	width:100%;
}
#brewery-page .links,
#brewery-page .brewery-container{
	width:65%;
	min-width:960px;
	max-width:1300px;
	margin:0 auto;
}
#brewery-page .brewery-container{
	min-height:760px;
}
.brewery-container header > img{
	width:42%;
	height:auto;
	float:left;
	margin-top:5%;
}
.brewery-container header > img.logo{
	width:16%;
	margin-top:0;
	position:relative;
	z-index:5;
}
.brewery-container section{
	text-align:center;
	position:relative;
	width:100%;
}
.brewery-container .loc-btn{
	position:absolute;
	width:100%;
	z-index:600;
	text-align:right;
	
}
.brewery-container .loc-btn > img{
	width:25%;
	cursor:pointer;
	/*margin-top:-12%;*/
}
.brewery-container .loc-btn > img:hover{
  animation-name: tada;
   -webkit-animation-name: tada;
} 
.brewery-container .nav-btn{
	position: absolute;
	width: 110%;
	margin-left:-5%;
	top: 37%;
	z-index: 600;
}
.brewery-container .nav-btn > img{
	width:5%;
	height:auto;
	cursor:pointer;
}
.brewery-container .nav-btn .next{
	float:right;
}
.brewery-container .nav-btn .prev{
	float:left;
}
/* SLIDE SHOW */
.swipe {
  overflow: hidden;
  visibility: hidden;
  position: relative;
}
.swipe-wrap {
  overflow: hidden;
  position: relative;
}
.swipe-wrap > div {
  float:left;
  width:100%;
  position: relative;
}
.swipe-wrap img{
	width:100%;
	height:auto;
	display:block;
}
.swipe-wrap > div .img-hldr {
	padding:22% 0;
	width:100%;
	background-position:center;
	background-repeat:no-repeat;
	background-size:100% 100%;
}

/* SLIDE SHOW END*/
.brewery-container section .slide{
	width:100%;
}
.brewery-container section .slide > img{
	width:100%;
	height:auto;
	margin-top:-3%;
}
.brewery-container section .cans{
	margin-top:-5%;
	position:relative;
	z-index:5;
}
.brewery-container section .can{
	width:33.33333%;
	float:left;
	box-sizing:border-box;
	position:relative;
	cursor:pointer;
}
.brewery-container section .can > img{
	width:40%;
	height:auto;
	position:relative;
	float:left;
	z-index:5;
	display:block;
}
.brewery-container section .can:hover > img{
  animation-name: tada;
   -webkit-animation-name: tada;
}
.brewery-container section .can > .desc{
	background:url(../img/brewery/beerbg.png) center no-repeat;
	background-size:100% 100%;
	width:60%;
	position:relative;
	margin-top:15%;
	right:5%;
	padding:4% 4% 3% 5%;
	text-align:center;
	box-sizing:border-box;
	float:left;
	z-index:1;
}
.brewery-container section .can .copy{
	padding:8% 0;
}
.brewery-container section .can .copy h3{
	margin:0;
	font-size:1.3em;
	font-family:'Stymie W01 Medium_928123';
	line-height:110%;
	letter-spacing:2px;
}
.brewery-container section .can .copy p{
	font-size:1.1em;
	font-family: 'pigeonregular';
	line-height:110%;
	width:80%;
	margin:0 auto;
}
#brewery-page #brewery-locs{
	display:none;
	position:absolute;
	height:100%;
	width:100%;
}
#brewery-page .brewery-locs{
