	width:50%;
	max-width:760px;
	min-width:600px;
}
#brewery-page .brewery-locs .locs-holder .list{
	padding:20% 5% 5% 5%;
	position:relative;
	margin:-19% auto 0 auto;
	width:90%;
	background:url(../img/brewery/list-bg.png) no-repeat;
	background-size:100% 100%;
}
.list-show{
	height: 400px;
	overflow-y: auto;
	padding: 0 7%;
}
.brewery-locs .locs-holder .locs-header{
	width:100%;
	height:auto;
	position:relative;
	z-index:10;
}
.brewery-locs .locs-holder .list .addr{ 
	float:left;
	width:70%;
	text-align:left;
}
.locs-holder .list .addr h2{	
	font-family: 'stymie medium';
	word-spacing:normal;
	font-size:1.5em;
	font-weight:bold;
	letter-spacing:normal;
