jQuery(document).ready(function($){
	if ($('#tribe-events-events-picker').length) {
		// we're on the grid view template. Insert our field into their form.
		appendField();
		filterLocations('grid');
		updateLocation();


	} else {
		filterLocations('list');
		updateLocation();
	}

	function filterLocations(template) {
		if (template == 'grid') {
			$(".fbr-venue-filter #location").live('change', function() {
				baseUrl = $(this).parents('form').attr("action");
				url = baseUrl + $('#tribe-events-events-year').val() + '-' + $('#tribe-events-events-month').val() + '?location=' + $(".fbr-venue-filter #location").val();
				window.location.href = url;

			});
