			$(".fbr-venue-filter #location").live('change', function() {
				baseUrl = document.location.pathname;
				//console.log('baseURL:',baseUrl);
				url = baseUrl + '?location=' + $(".fbr-venue-filter #location").val();
				window.location.href = url;
			});
		}
	} 

	function appendField() {
		$('.fbr-venue-filter').appendTo('#tribe-events-events-picker');
	}

