		var curSelection = $('.fbr-venue-filter #location option:selected').text();
		var loc = 'All Locations';
		if (curSelection != 'Select Location' && curSelection != 'All Locations') {loc = curSelection;}
		$('.fbr_location_view .fbr_loc_name').text(loc);
	}
});

