	}
	$('#feedbackform .details').slideDown();
});
$('#feedbackform').submit(function(e){
	e.preventDefault();
	var submitBtn = $('#fbsubmit');

	function disable(){
		submitBtn.attr('disabled','disabled');
		submitBtn.val('SENDING...');
	}
	disable();

	if(exp == false){
		alert('Select Good/Bad Experience');
	}else{

		var err=false;

		var req_fields = {
			name: this.fbname,
			email: this.fbemail,
			phone: this.fbphone,
			state: this.fbstate,
			loc: this.fblocation,
			rate: this.fbrate,
			experience: this.fbexperience,
			attitude: this.fbattitude,
			order: this.fborder,
			value: this.fbvalue,
			recommend: this.fbrecommend,
			suggestion: this.fbsuggestion

		}

		var fields = {
			vMonth: this.month,
			vDay: this.day,
			vYear: this.year,
			vTime: this.time,
			tpgName: this.tpgName,
			expdetails: this.fbexpdetails,
			attdetails: this.fbattdetails,
			orderdetails: this.fborderdetails,
			price: this.fbprice
		}

		var values = {};
		for(var field in req_fields){
		 if(req_fields.hasOwnProperty(field)){
			if(req_fields[field].value==''){
				req_fields[field].style.border="1px solid red";
				alert('Enter missing information please.');

				submitBtn.removeAttr('disabled').attr('value','SUBMIT');
				err=true;
				break;
			}else{
				values[field] = req_fields[field].value;
				req_fields[field].style.border="1px solid #000";
			}
		 }
		}

		//validate email
		var email = this.fbemail.value;
		var emailRE = /^[\w-\.]+@([\w-]+\.)+[\w-]{2,4}$/;
		var check = emailRE.test(email);

		if(check == false){
			err=true;
			submitBtn.removeAttr('disabled').attr('value','SUBMIT');
			alert('Email must be \'example@server.com\'');
		}

		//validate phone
		var phone = this.fbphone.value;
		var phoneRE = /^\D?(\d{3})\D?\D?(\d{3})\D?(\d{4})$/;
		var check = phoneRE.test(phone);

		if(check == false){
			err=true;
			submitBtn.removeAttr('disabled').attr('value','SUBMIT');
			alert('Phone must be \'(111) 222-3333\' or \'111-222-3333\'.');
		}

		for(var field2 in fields){
		 if(fields.hasOwnProperty(field2)){
			values[field2] = fields[field2].value;
		 }
		}

		if(err==false){
			submitBtn.attr('disabled','disabled');
			values['action'] = 'ajaxHandler';
			values['overall'] = exp;
			//console.log(values)
			$.ajax({
			  type: "POST",
			  url: "/wp-admin/admin-ajax.php",
			  data: values
			}).done(function( msg ) {
			    //console.log( msg );
			    alert('Thank you for your submission!');
			    submitBtn.attr('value','SENT!');
			    window.location = 'http://twinpeaksrestaurant.com/';
			});
		}
	}
});
