	//Declare variables
	var x = document.getElementById("brewery-locs");
	var list = document.getElementById("list");
	var closes = {}
	var stores = new Array();
	var dirBtn = 'http://www.twinpeaksrestaurant.com/wp-content/themes/twinpeaks-fbr/img/brewery/dir-btn.png';

	//Calculate distance between 2 points
	function distance(lat1, lon1, lat2, lon2, unit) {
		var radlat1 = Math.PI * lat1/180
		var radlat2 = Math.PI * lat2/180
		var radlon1 = Math.PI * lon1/180
		var radlon2 = Math.PI * lon2/180
		var theta = lon1-lon2
		var radtheta = Math.PI * theta/180
		var dist = Math.sin(radlat1) * Math.sin(radlat2) + Math.cos(radlat1) * Math.cos(radlat2) * Math.cos(radtheta);
		dist = Math.acos(dist)
		dist = dist * 180/Math.PI
		dist = dist * 60 * 1.1515
		if (unit=="K") { dist = dist * 1.609344 }
		if (unit=="N") { dist = dist * 0.8684 }
		return dist;
	}

	$('#getLocation').click(function(){
		if ("geolocation" in navigator) {
			var watchId = navigator.geolocation.getCurrentPosition(scrollMap, handleError);
		} else {
			handleError();
		}
	});	

	$('#exit').click(function(){
		x.style.display = 'none';
	});

	 function scrollMap(p) {
		var i=0;
		//Calculate distance for every location
		for (var key in locs) {
			var miles = distance(locs[key]['lat'], locs[key]['lon'], p.coords.latitude, p.coords.longitude,'K');
			//console.log(miles);

			//store distance (loc, distance)
			stores[i] = [i,miles];
			//store distances only
			closes[i] = [miles];

			i++;
		}

		//min-max function for 2nd value only
		function sortBySize(a,b){
			return a[1] - b[1];
		}

		//arrange 2nd value of stores array
		distSorted = stores.sort(sortBySize);

		//clear list before display
		list.innerHTML= '';

		//display the 5 closes locations
		for(var c=0; c < 5; c++) {
			//console.log(distSorted[c][0]);
			//console.log(locs[distSorted[c][0]].name,locs[distSorted[c][0]].addr,locs[distSorted[c][0]].glink);
			var n = locs[distSorted[c][0]].name;
			var addr = locs[distSorted[c][0]].addr;
			var glink = locs[distSorted[c][0]].glink;

			//console.log(locs[distSorted[c][0]].name);

			list.innerHTML = list.innerHTML + '<div class="loc"><div class="addr"><h2>'+n+'</h2><p>'+addr+'</p></div><a href="'+glink+'" target="_blank" class="dir-btn"><img src="'+dirBtn+'" alt="" /></a><div class="clear"></div><div class="dots"></div></div>';
		}

		x.style.display = 'block';
	 }

	 function handleError() {	
		list.innerHTML = '';
		for (var key in locs) {
			var n = locs[key]['name'];
			var addr = locs[key]['addr'];
			var glink = locs[key]['glink'];

